import React from "react";
import './App.css';
import DashboardCard from "./components/Card/card";
import NasaCard from "./widgets/nasa";
import FluidGrid from 'react-fluid-grid'
import {Button} from "react-bootstrap";

const styleStrategies = [
    { mediaQuery: '(max-width: 719.9px)', style: { numberOfColumns: 1, gutterHeight: 5, gutterWidth: 0 } },
    { mediaQuery: '(min-width: 720px) and (max-width: 1023.9px)', style: { numberOfColumns: 2, gutterHeight: 15, gutterWidth: 15 } },
    { mediaQuery: '(min-width: 1024px)', style: { numberOfColumns: 3, gutterHeight: 30, gutterWidth: 30 } }
];

const transition = 'top 100ms ease-in-out, left 100ms ease-in-out';

function Home() {
    var array = [];
    array.concat(<NasaCard rover={"Spirit"} param={"random"}/>);
    array.concat(<DashboardCard/>);
    array.concat(<DashboardCard/>);
    array.concat(<NasaCard rover={"Curiosity"}/>);
    // array.map(card => (console.log(card)));
    console.log(array);
    return (
        <div>
            <div style={{padding: 10}}>
                <FluidGrid styleStrategies={styleStrategies} transition={transition}>
                    <></>
                    <></>
                    {
                        array.map(card => (
                            {card}
                        ))
                    }
                        {/*<NasaCard rover={"Spirit"} param={"random"}/>*/}
                        {/*<DashboardCard/>*/}
                        {/*<DashboardCard/>*/}
                        {/*<DashboardCard/>*/}
                        {/*<NasaCard rover={"Curiosity"}/>*/}
                        {/*<NasaCard rover={"Opportunity"} param={"random"}/>*/}
                </FluidGrid>
            </div>
            <Button style={{position: "fixed", zIndex:"99", top:"90%", left:"93%"}}>+</Button>
        </div>
    );
}

export default Home;
